function alertBox(string, Opt, callback) {
    var $body = jQuery('body');
    var alertBoxTextBoxSelector = '.alertBoxTextbox';
    var $alertBoxTextbox = jQuery(alertBoxTextBoxSelector);

    jQuery('#alertBoxOverlay').fadeOut(300).remove();
    jQuery('#alertBox').remove();

    var arguments = {
        'confirm': false,
        'verify': false,
        'input': false,
        'textOk': 'Ok',
        'textCancel': 'Cancel',
        'textYes': 'Yes',
        'textNo': 'No'
    };

    if (Opt) {
        for (var index in arguments) {
            if (typeof Opt[index] == "undefined") {
                Opt[index] = arguments[index];
            }
        }
    }

    $body.append('<div class="alertBoxOverlay" id="alertBoxOverlay"></div>');
    jQuery('.alertBoxOverlay').fadeIn(100);
    $body.append('<div id="alertBox" class="alertBoxOuter"></div>');
    var $alertBoxOuter = jQuery('.alertBoxOuter');
    $alertBoxOuter.append('<div class="alertBoxInner"></div>');
    var $alertBoxInner = jQuery('.alertBoxInner');
    $alertBoxInner.append(string);
    $alertBoxOuter.css("left", ( jQuery(window).width() - $alertBoxOuter.width() ) / 2 + jQuery(window).scrollLeft() + "px");
    $alertBoxOuter.css('top', '100px').fadeIn(200);

    if (Opt) {
        if (Opt['input']) {
            if (typeof(Opt['input']) == 'string') {
                $alertBoxInner.append('<div class="alertBoxInput"><input type="text" class="alertBoxTextbox" value="' + Opt['input'] + '" /></div>');
            } else {
                $alertBoxInner.append('<div class="alertBoxInput"><input type="text" class="alertBoxTextbox" /></div>');
            }

            $alertBoxTextbox.focus();
        }
    }

    $alertBoxInner.append('<div class="alertBoxButtons"></div>');
    var $alertBoxButtons = jQuery('.alertBoxButtons');

    if (Opt) {
        if (Opt['confirm'] || Opt['input']) {
            $alertBoxButtons.append('<button value="ok">' + Opt['textOk'] + '</button><button value="cancel">' + Opt['textCancel'] + '</button>');
        } else if (Opt['verify']) {
            $alertBoxButtons.append('<button value="ok">' + Opt['textYes'] + '</button><button value="cancel">' + Opt['textNo'] + '</button>');
        } else {
            $alertBoxButtons.append('<button value="ok">' + Opt['textOk'] + '</button>');
        }
    } else {
        $alertBoxButtons.append('<button value="ok">Ok</button>');
    }

    jQuery(document).keydown(function (e) {
        if (jQuery('.alertBoxOverlay').is(':visible')) {
            if (e.keyCode == 13 || e.keyCode == 32) { //enter or spacebar
                jQuery('.alertBoxButtons > button[value="ok"]').click();
            }
            if (e.keyCode == 27) {
                jQuery('.alertBoxButtons > button[value="cancel"]').click();
            }
        }
    });

    var alertText = $alertBoxTextbox.val();
    if (!alertText) {
        alertText = false;
    }

    $body.on('keyup', alertBoxTextBoxSelector, function () {
        alertText = jQuery(this).val();
    });

    jQuery('.alertBoxButtons > button').click(function () {
        jQuery('.alertBoxOverlay').remove();
        jQuery('.alertBoxOuter').remove();
        if (callback) {
            var alertButton = jQuery(this).prop("value");
            if (alertButton == 'ok') {
                if (Opt) {
                    if (Opt['input']) {
                        callback(alertText);
                    } else {
                        callback(true);
                    }
                } else {
                    callback(true);
                }
            } else if (alertButton == 'cancel') {
                callback(false);
            }
        }
    });
}
